import React, { Component } from 'react';
import AddPost from '../components/body/addPost'
import Grid from '@material-ui/core/Grid'


class Home extends Component {
  constructor(props){
    super(props)
  }

  render() {

    return (
      <div style={{  display: 'flex', flexDirection: 'column'}}><AddPost /></div>
    );
  }
}
export default (Home);
